import React from 'react';
import {connect} from "react-redux";
import ConversationsHeader from "./ConversationsHeader";
import ConversationsBody from "./ConversationsBody";
import axis from "axis.js";

class SenderConversations extends React.Component {
    constructor(props) {
        super(props);
    }

    render () {

        let conversations = [];

        if(this.props.conversation.data){
            conversations = this.props.conversation.receivers;
        }

        return (
                <div className={`box box-solid user-conversation ${!axis.isUndefined(this.props.conversation.showDetails) && this.props.conversation.showDetails ? 'show-details' : ''}`}>
                    <ConversationsHeader conversations={conversations}/>
                    <ConversationsBody conversations={conversations} />
                </div>
        );
    }
}
const mapStateToProps = state => state;

export default connect(mapStateToProps)(SenderConversations);
